//! Calculate a Pt100 RTD's temperature reading from calculated probe resistance.
//!
//! ## References
//!
//! * [1] “ITS-90 Thermocouple Database, How to Use the Database.”
//!   Accessed: May 19, 2024. [Online]. Available:
//!   <https://srdata.nist.gov/its90/useofdatabase/use_of_database.html#Coefficients%20Tables>
use once_cell::sync::Lazy;

use interpn::MulticubicRegular;

use super::*;
use crate::{calc_config, calc_input_names, calc_output_names};

/// Temperature interpolator shared between all instances of the calc.
///
/// This interpolator must be initialized on first access, because the
/// interpolator's `new` function is not const, but we make sure to call it once during
/// init so that it does not cause additional cycle delay during the first operating cycle.
pub static INTERPOLATOR: Lazy<MulticubicRegular<'static, f64, 1>> = Lazy::new(|| {
    MulticubicRegular::new(
        &[PROBE_RESISTANCE_N],
        &[PROBE_RESISTANCE_START_OHM],
        &[PROBE_RESISTANCE_STEP_OHM],
        &PROBE_TEMP_K,
        true,
    )
    .unwrap()
});

/// Derive input voltage from amplifier output
#[derive(Serialize, Deserialize, Default, Debug)]
pub struct RtdPt100 {
    // User inputs
    resistance_name: String,
    save_outputs: bool,

    // Values provided by calc orchestrator during init
    #[serde(skip)]
    input_index: usize,

    #[serde(skip)]
    output_index: usize,
}

impl RtdPt100 {
    pub fn new(resistance_name: String, save_outputs: bool) -> Self {
        // These will be set during init.
        // Use default indices that will cause an error on the first call if not initialized properly
        let input_index = usize::MAX;
        let output_index = usize::MAX;

        Self {
            resistance_name,
            save_outputs,

            input_index,
            output_index,
        }
    }
}

#[typetag::serde]
impl Calc for RtdPt100 {
    /// Reset internal state and register calc tape indices
    fn init(&mut self, _: ControllerCtx, input_indices: Vec<usize>, output_range: Range<usize>) {
        self.input_index = input_indices[0];
        self.output_index = output_range.clone().next().unwrap();

        // Call the interpolator once to make sure it is initialized
        INTERPOLATOR.interp_one(&[0.0]).unwrap();
    }

    fn terminate(&mut self) {
        self.input_index = usize::MAX;
        self.output_index = usize::MAX;
    }

    /// Run calcs for a cycle
    fn eval(&mut self, tape: &mut [f64]) {
        let sensed_resistance = tape[self.input_index];

        // An error here would indicate that we have encountered an unrepresentable number during interpolation.
        // As of writing, no method of producing an error here is known.
        let y = INTERPOLATOR.interp_one(&[sensed_resistance]).unwrap();

        tape[self.output_index] = y;
    }

    /// Map from input field names (like `v`, without prefix) to the state name
    /// that the input should draw from (like `peripheral_0.output_1`, with prefix)
    fn get_input_map(&self) -> BTreeMap<CalcInputName, FieldName> {
        let mut map = BTreeMap::new();
        map.insert("resistance_ohm".to_owned(), self.resistance_name.clone());
        map
    }

    /// Change a value in the input map
    fn update_input_map(&mut self, field: &str, source: &str) -> Result<(), String> {
        if field == "resistance_ohm" {
            self.resistance_name = source.to_owned();
        } else {
            return Err(format!("Unrecognized field {field}"));
        }

        Ok(())
    }

    calc_config!();
    calc_input_names!(resistance_ohm);
    calc_output_names!(temperature_K);
}

#[cfg(test)]
mod test {
    use super::INTERPOLATOR;

    #[test]
    fn test_interpolator() {
        // Check the interpolator against a value from the table
        let inp = [19.82];
        let interped = INTERPOLATOR.interp_one(&inp).unwrap();
        let expected = -197.0 + 273.15;
        println!("{interped}, {expected}");
        let rel_err = (interped - expected) / expected;
        assert!(rel_err.abs() < 1e-8);
    }
}

